import { FETCH_TODOS_1 } from "../action_types";

const initialState = [];
const TODOS_1_URL = "https://jsonplaceholder.typicode.com/todos";
const fetchTodos_1 = () => {
   return fetch(TODOS_1_URL)
      .then((response) => response.json())
      // .then((jsonData) => JSON.stringify(jsonData));
};
console.log(fetchTodos_1());
const todos_1_reducer = (state = initialState, action) => {
   switch (action.type) {
      case FETCH_TODOS_1:
         break;

      default:
         return state;
   }
};

export default todos_1_reducer;
